    player_kickingAcceleration: json_stadium_futsal_vehax_v1_v2_bar["playerPhysics"]["kickingAcceleration"],
    player_kickingDamping: 0.96,
    player_kickStrength: json_stadium_futsal_vehax_v1_v2_bar["playerPhysics"]["kickStrength"],
    ball_radius: json_stadium_futsal_vehax_v1_v2_bar["discs"][0]["radius"],
